import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import { BrowserRouter, Routes, Route, NavLink } from "react-router-dom";
import './Sidebar.css';

export default props => {
  return (
    <Menu>
      <NavLink className="menu-item" to="#">
        Home
      </NavLink>
      <NavLink className="menu-item" to="#">
        Comprar
      </NavLink>
      <NavLink className="menu-item" to="#">
        Vender
      </NavLink>
      <NavLink className="menu-item" to="#">
        Calendario
      </NavLink>
      <NavLink className="menu-item" to="#">
        Carrito
      </NavLink>
      <NavLink className="menu-item" to="#">
        Mi perfil
      </NavLink>
    </Menu>
  );
};
